import {
	Box,
} from '@chakra-ui/react';
import { useState, useEffect } from "react";

const Card = (props) => {
  useEffect(()=>{
    if(!props.user){
				window.location = "/login";
    }
	},[])
		return (
			<Box
			w='400px'
			rounded='20px'
			border='1px solid'
			boxShadow='sm'
			borderColor='gray.300'
			fontSize="40px"
			mt="40vh">Hello {props.user.first_name} {props.user.last_name}</Box>
		)
};

export default Card;
